pragma solidity ^0.8.20;

contract A{
    address public owner;

    constructor(){
        owner = address(this);
    }

    function showSender() public view returns(address){
        return(msg.sender);
    }
    function showOwner() public view returns(address){
        return(owner);        
    }    

}

contract B{
    A public token;
    address public owner;

    constructor(){
        token = new A();
        owner = msg.sender;
    }

    function showSender() public view returns(address){
        return(token.showSender());
    }
    function showOwner() public view returns(address){
        return(token.showOwner());
    }    
}

